import React from 'react';
import { Layout } from 'antd';

import Navbar from './Navbar/Navbar';

const { Content } = Layout;

class CustomLayout extends React.Component {
    render() {
    return (
            <div style={{
                padding: 24,
                minHeight: 280}}>
                {this.props.children}
            </div>

    )
    }
}

export default CustomLayout;
